package com.kh.example.practice1.model;

public class lotto {

	private int num;
	private int count;
	public lotto(int num, int count) {
		this.num = num;
		this.count = count;
	}
	public lotto() {
		// TODO Auto-generated constructor stub
	}
	public int getNum() {
		return num;
	}
	public void setNum(int num) {
		this.num = num;
	}
	public int getCount() {
		return count;
	}
	public void setCount(int count) {
		this.count = count;
	}
}
